First, lets create the class for an item! Lets start by creating a simple class (usually in common.items) that extends Item: class ExampleFuelItem extends Item { public ExampleFuelItem (final Item.Properties properties) { super(properties); }
} Then, lets override getBurnTime. This is a forge method, so its the same for any mappings! class ExampleFuelItem extends Item { public ExampleFuelItem (final Item.Properties properties) { super(properties); } @Override public int getBurnTime(ItemStack itemStack) { return 14400; // The length of burning in ticks! }
} Once we've returned the correct value, we can close and save the class!
